import Vue from 'vue'
import App from './pages/App.vue'
import Event from './pages/Event.vue'
import VueRouter from 'vue-router'
import router from './routes';



Vue.use(VueRouter);

Vue.config.productionTip = false;

new Vue({
   el: '#app',
   router:router,
  render: h => h(App),
})
new Vue({

  router:router,
 render: h => h(Event),
}).$mount();
